import React, { Component } from 'react'
import { Steps, Button, message } from 'antd';
import Navigation from '../Navigation/Navigation'
import 'antd/dist/antd.css'
import 'antd/lib/style/themes/default.less';
import Checkoutpage from './RightMenu/CheckOut'
import Preload from './RightMenu/Preload'
import 'antd/dist/antd.less'; // Import Ant Design styles by less entry
const { Step } = Steps;
export default class NewFront extends  React.Component {
    constructor(props) {
        super(props);
        this.state = {
            current: 0,
        };
    }


  onChange = current => {
    console.log('onChange:', current);
    this.setState({ current });
  };

    next() {
        const current = this.state.current + 1;
        this.setState({ current });
    }

    prev() {
        const current = this.state.current - 1;
        this.setState({ current });
    }

    render() {
        const { current } = this.state;
        return (
            <div>
        <Navigation/>
        <Steps
          size="small"
          type="navigation"
          current={current}
          onChange={this.onChange}
          className="site-navigation-steps"
        >
          <Step status="process" title="Step 1" />
          <Step status="process" title="Step 2" />
          <Step status="process" title="Step 3" />
          <Step status="process" title="Step 4" />
          <Step status="process" title="Step 5" />
          <Step status="process" title="Step 6" />
          <Step status="process" title="Step 7" />
        </Steps>
        <div style={{ backgroundColor:"red", width: "49vw", height: "100vh", float: "left", overflowY: "scroll" }}></div>
        <div style={{ backgroundColor:"green", height: "100vh", width: "49vw", display: "inline-table", float: "left" }}></div>
                    <button id="tabRed" class="tablink" onClick={this.handleClickCheckout} id="tabDefaultOpen">Checkout Page</button>
                    <button id="tabGreen" class="tablink" onClick={this.handleClickPreload} >Preload Response</button>
                    <button id="tabBlue" class="tablink" onClick="openPage('receipt', this, '#6DC7BE')">Receipt Response</button>
                    <div>
                        <Checkoutpage ifShow={this.state.pageDisplay} />
                        <Preload ifShow={this.state.pageDisplay} />
                    </div>
        </div>
        )
    }
}
